import './CinemaCard.css';
import React from 'react';




const CinemaCard = ({sede, funcion}) => {
    return (
        <div className='mx-3'>
            <div class="card">
                <buttom class="card-header" type="button" data-bs-toggle="collapse" data-bs-target="#collapseExample" aria-expanded="false" aria-controls="collapse">
                    {sede}
                </buttom>
                <div class="card-body collapse" id='collapse'>
                    <h5 class="card-title">{funcion.dimension}+" "+{funcion}</h5>
                    <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
                    <a href="" class="btn btn-primary">Go somewhere</a>
                </div>
            </div>
        </div>
    );
}

export default CinemaCard;
